D0%BA%D0%BE%D0%B5\" title=\"\u0422\u0440\u0438\u0433\u043e\u0440\u0441\u043a\u043e\u0435\">\u0422\u0440\u0438\u0433\u043e\u0440\u0441\u043a\u043e\u0433\u043e<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%83%D1%88%D0%BA%D0%B8%D0%BD,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041f\u0443\u0448\u043a\u0438\u043d, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0421\u0435\u0440\u0433\u0435\u0435\u0432\u0438\u0447\">\u041f\u0443\u0448\u043a\u0438\u043d<\/a> \u0432\u0440\u0443\u0447\u0438\u043b \u0435\u0439 \u0441\u0442\u0438\u0445\u043e\u0442\u0432\u043e\u0440\u0435\u043d\u0438\u0435 \u00ab\u041a*\u00bb (\u00ab\u042f \u043f\u043e\u043c\u043d\u044e \u0447\u0443\u0434\u043d\u043e\u0435 \u043c\u0433\u043d\u043e\u0432\u0435\u043d\u044c\u0435\u00bb). \u0427\u0435\u0440\u0435\u0437 15 \u043b\u0435\u0442 \u043a\u043e\u043c\u043f\u043e\u0437\u0438\u0442\u043e\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BB%D0%B8%D0%BD%D0%BA%D0%B0,_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0413\u043b\u0438\u043d\u043a\u0430, \u041c\u0438\u0445\u0430\u0438\u043b \u0418\u0432\u0430\u043d\u043e\u0432\u0438\u0447\">\u0413\u043b\u0438\u043d\u043a\u0430<\/a> \u043d\u0430\u043f\u0438\u0441\u0430\u043b \u0440\u043e\u043c\u0430\u043d\u0441 \u043d\u0430 \u044d\u0442\u0438 \u0441\u043b\u043e\u0432\u0430 \u0438 \u043f\u043e\u0441\u0432\u044f\u0442\u0438\u043b \u0435\u0433\u043e \u0436\u0435\u043d\u0449\u0438\u043d\u0435, \u0432 \u043a\u043e\u0442\u043e\u0440\u0443\u044e \u0431\u044b\u043b \u0432\u043b\u044e\u0431\u043b\u0451\u043d,&#160;\u2014 \u0434\u043e\u0447\u0435\u0440\u0438 \u0410\u043d\u043d\u044b \u041a\u0435\u0440\u043d \u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1870\" class=\"mw-redirect\" title=\"1870\">1870<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B2%D1%8F%D1%82%D0%BE%D0%B9_%D0%9F%D1%80%D0%B5%D1%81%D1%82%D0%BE%D0%BB\" title=\"\u0421\u0432\u044f\u0442\u043e\u0439 \u041f\u0440\u0435\u0441\u0442\u043e\u043b\">\u0421\u0432\u044f\u0442\u043e\u0439 \u041f\u0440\u0435\u0441\u0442\u043e\u043b<\/a> \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0441\u0438\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BE%D0%B3%D0%BC%D0%B0%D1%82_%D0%BE_%D0%BF%D0%B0%D0%BF%D1%81%D0%BA%D0%BE%D0%B9_%D0%B1%D0%B5%D0%B7%D0%BE%D1%88%D0%B8%D0%B1%D0%BE%D1%87%D0%BD%D0%BE%D1%81%D1%82%D0%B8\" class=\"mw-redirect\" title=\"\u0414\u043e\u0433\u043c\u0430\u0442 \u043e \u043f\u0430\u043f\u0441\u043a\u043e\u0439 \u0431\u0435\u0437\u043e\u0448\u0438\u0431\u043e\u0447\u043d\u043e\u0441\u0442\u0438\">\u0434\u043e\u0433\u043c\u0430\u0442 \u043e \u043f\u0430\u043f\u0441\u043a\u043e\u0439 \u0431\u0435\u0437\u043e\u0448\u0438\u0431\u043e\u0447\u043d\u043e\u0441\u0442\u0438<\/a>. \u042d\u0442\u043e \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u0431\u044b\u043b\u043e \u043f\u0440\u0438\u043d\u044f\u0442\u043e \u043d\u0430 I \u0412\u0430\u0442\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u043c \u0441\u043e\u0431\u043e\u0440\u0435 \u0432 \u0430\u043f\u0440\u0435\u043b\u0435 553 \u0433\u043e\u043b\u043e\u0441\u0430\u043c\u0438 \u043f\u0440\u043e\u0442\u0438\u0432 \u0434\u0432\u0443\u0445. \u0414\u043e\u0433\u043c\u0430\u0442 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u044f\u0435\u0442, \u0447\u0442\u043e \u043a\u043e\u0433\u0434\u0430 \u043f\u0430\u043f\u0430 \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0430\u0435\u0442 \u00abex catedra\u00bb, \u0442\u043e \u0435\u0441\u0442\u044c \u043a\u0430\u043a \u0433\u043b\u0430\u0432\u0430 \u0426\u0435\u0440\u043a\u0432\u0438, \u0443\u0447\u0435\u043d\u0438\u0435 \u0426\u0435\u0440\u043a\u0432\u0438, \u043a\u0430\u0441\u0430\u044e\u0449\u0435\u0435\u0441\u044f \u0432\u0435\u0440\u044b \u0438\u043b\u0438 \u043c\u043e\u0440\u0430\u043b\u0438&#160;\u2014 \u044d\u0442\u043e \u0443\u0447\u0435\u043d\u0438\u0435 \u043e\u0431\u043b\u0430\u0434\u0430\u0435\u0442 \u0431\u0435\u0437\u043e\u0448\u0438\u0431\u043e\u0447\u043d\u043e\u0441\u0442\u044c\u044e.<\/li><li>\u041d\u0430\u0447\u0430\u043b\u0430\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D0%BA%D0%BE-%D0%BF%D1%80%D1%83%D1%81%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0424\u0440\u0430\u043d\u043a\u043e-\u043f\u0440\u0443\u0441\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0424\u0440\u0430\u043d\u043a\u043e-\u043f\u0440\u0443\u0441\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1886\" class=\"mw-redirect\" title=\"1886\">1886<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%8E%D0%BA%D1%81%D0%B5%D0%BC%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u041b\u044e\u043a\u0441\u0435\u043c\u0431\u0443\u0440\u0433\">\u041b\u044e\u043a\u0441\u0435\u043c\u0431\u0443\u0440\u0433\u0435<\/a> \u0441\u0432\u043e\u0439 \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0439 \u043a\u043e\u043d\u0446\u0435\u0440\u0442 \u0434\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D1%81%D1%82,_%D0%A4%D0%B5%D1%80%D0%B5%D0%BD%D1%86\" title=\"\u041b\u0438\u0441\u0442, \u0424\u0435\u0440\u0435\u043d\u0446\">\u0424\u0435\u0440\u0435\u043d\u0446 \u041b\u0438\u0441\u0442<\/a>. \u0427\u0435\u0440\u0435\u0437 \u0434\u0432\u0430 \u0434\u043d\u044f \u043e\u043d \u043f\u0440\u0438\u0431\u044b\u043b \u0432 \u0411\u0430\u0439\u0440\u043e\u0439\u0442 (\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f) \u0434\u043b\u044f \u0443\u0447\u0430\u0441\u0442\u0438\u044f \u0432 \u0412\u0430\u0433\u043d\u0435\u0440\u043e\u0432\u0441\u043a\u0438\u0445 \u0442\u043e\u0440\u0436\u0435\u0441\u0442\u0432\u0430\u0445. \u041a\u043e\u043c\u043f\u043e\u0437\u0438\u0442\u043e\u0440 \u0441\u043b\u0451\u0433 \u0432 \u043f\u043e\u0441\u0442\u0435\u043b\u044c \u0441 \u0441\u0438\u043b\u044c\u043d\u043e\u0439 \u043f\u0440\u043e\u0441\u0442\u0443\u0434\u043e\u0439, \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u043f\u0435\u0440\u0435\u0448\u043b\u0430 \u0432 \u0432\u043e\u0441\u043f\u0430\u043b\u0435\u043d\u0438\u0435 \u043b\u0451\u0433\u043a\u0438\u0445, \u0438 \u0432 \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0439 \u0434\u0435\u043d\u044c \u043c\u0435\u0441\u044f\u0446\u0430 \u0441\u043a\u043e\u043d\u0447\u0430\u043b\u0441\u044f \u043d\u0430 75 \u0433\u043e\u0434\u0443 \u0436\u0438\u0437\u043d\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1900\" class=\"mw-redirect\" title=\"1900\">1900<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1900_%D0%B3%D0%BE%D0%B4_%D0%B2_%D0%B8%D1%81%D1%82%D0%BE%D1%80%D0%B8%D0%B8_%D0%BC%D0%B5%D1%82%D1%80%D0%BE%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%B5%D0%BD%D0%B0\" title=\"1900 \u0433\u043e\u0434 \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u043c\u0435\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0435\u043d\u0430\">\u043e\u0442\u043a\u0440\u044b\u043b\u0441\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B5%D1%82%D1%80%D0%BE%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%B5%D0%BD\" title=\"\u041f\u0430\u0440\u0438\u0436\u0441\u043a\u0438\u0439 \u043c\u0435\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0435\u043d\">\u041f\u0430\u0440\u0438\u0436\u0441\u043a\u0438\u0439 \u043c\u0435\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0435\u043d<\/a>. \u0420\u0443\u043a\u043e\u0432\u043e\u0434\u0438\u043b \u0435\u0433\u043e \u0441\u043e\u043e\u0440\u0443\u0436\u0435\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%8C%D0%B5%D0%BD%D0%B2%D0%B5%D0%BD%D1%8E,_%D0%A4%D1%8E%D0%BB%D1%8C%D0%B6%D0%B0%D0%BD%D1%81_%D0%9C%D0%B0%D1%80%D0%B8_%D0%9E%D0%B3%D1%8E%D1%81%D1%82\" title=\"\u0411\u044c\u0435\u043d\u0432\u0435\u043d\u044e, \u0424\u044e\u043b\u044c\u0436\u0430\u043d\u0441 \u041c\u0430\u0440\u0438 \u041e\u0433\u044e\u0441\u0442\">\u0424\u044e\u043b\u044c\u0436\u0430\u043d\u0441 \u0411\u044c\u0435\u043d\u0432\u0435\u043d\u044e<\/a>, \u0430 \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u0441\u0442\u0430\u043d\u0446\u0438\u0439 \u043c\u0435\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0435\u043d\u0430 \u0448\u043b\u043e \u043f\u043e\u0434 \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0441\u0442\u0432\u043e\u043c \u0430\u0440\u0445\u0438\u0442\u0435\u043a\u0442\u043e\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B8%D0%BC%D0%B0%D1%80,_%D0%AD%D0%BA%D1%82%D0%BE%D1%80\" title=\"\u0413\u0438\u043c\u0430\u0440, \u042d\u043a\u0442\u043e\u0440\">\u042d\u043a\u0442\u043e\u0440\u0430 \u0413\u0438\u043c\u0430\u0440\u0430<\/a>.<\/li><\/ul><h3>XX \u0432\u0435\u043a<\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1905\" class=\"mw-redirect\" title=\"1905\">1905<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438<\/a> \u043d\u0430 \u0441\u044a\u0435\u0437\u0434\u0435 \u0437\u0435\u043c\u0441\u043a\u0438\u0445 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043b\u0435\u0439 \u043f\u0440\u0438\u0437\u043d\u0430\u043d\u0430 \u043f\u0440\u043e\u0432\u0430\u043b\u0438\u0432\u0448\u0435\u0439\u0441\u044f \u043f\u043e\u043f\u044b\u0442\u043a\u0430 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u044f \u0432\u044b\u0431\u043e\u0440\u043d\u043e\u0433\u043e \u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u044f \u0432 \u0440\u0430\u043c\u043a\u0430\u0445 \u043a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u043e\u043d\u043d\u043e\u0439 \u043c\u043e\u043d\u0430\u0440\u0445\u0438\u0438 \u0438 \u043d\u0430\u0447\u0430\u0442\u0430 \u0440\u0430\u0437\u0440\u0430\u0431\u043e\u0442\u043a\u0430 \u043f\u0440\u043e\u0435\u043a\u0442\u0430 \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u043a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1908\" class=\"mw-redirect\" title=\"1908\">1908<\/a>&#160;\u2014 \u0412 \u041b\u043e\u043d\u0434\u043e\u043d\u0441\u043a\u043e\u043c \u0441\u043e\u0431\u043e\u0440\u0435 \u0441\u0432\u044f\u0442\u043e\u0433\u043e \u041f\u0430\u0432\u043b\u0430 \u0435\u043f\u0438\u0441\u043a\u043e\u043f, \u0431\u043b\u0430\u0433\u043e\u0441\u043b\u043e\u0432\u043b\u044f\u044f \u041e\u043b\u0438\u043c\u043f\u0438\u0430\u0434\u0443, \u043f\u0440\u043e\u0438\u0437\u043d\u0451\u0441 \u0444\u0440\u0430\u0437\u0443: \u00ab\u0413\u043b\u0430\u0432\u043d\u043e\u0435&#160;\u2014 \u043d\u0435 \u043f\u043e\u0431\u0435\u0434\u0430, \u0430 \u0443\u0447\u0430\u0441\u0442\u0438\u0435\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1909\" class=\"mw-redirect\" title=\"1909\">1909<\/a>&#160;\u2014 \u0424\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0439 \u043b\u0451\u0442\u0447\u0438\u043a <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%9B%D0%B0%D1%82%D0%B0%D0%BC,_%D0%AE%D0%B1%D0%B5%D1%80&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u041b\u0430\u0442\u0430\u043c, \u042e\u0431\u0435\u0440 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u042e\u0431\u0435\u0440 \u041b\u0430\u0442\u0430\u043c<\/a>, \u043f\u0440\u0438\u043d\u044f\u0432 \u0432\u044b\u0437\u043e\u0432 \u0433\u0430\u0437\u0435\u0442\u044b \u00ab\u0414\u0435\u0439\u043b\u0438 \u041c\u0435\u0439\u043b\u00bb, \u043f\u0440\u0435\u0434\u043b\u043e\u0436\u0438\u0432\u0448\u0435\u0439 1000 \u0444\u0443\u043d\u0442\u043e\u0432 \u0441\u0442\u0435\u0440\u043b\u0438\u043d\u0433\u043e\u0432 \u043f\u0435\u0440\u0432\u043e\u043c\u0443 \u043f\u0438\u043b\u043e\u0442\u0443, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043f\u0435\u0440\u0435\u043b\u0435\u0442\u0438\u0442 \u043d\u0430 \u0430\u044d\u0440\u043e\u043f\u043b\u0430\u043d\u0435 \u0447\u0435\u0440\u0435\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0-%D0%9C%D0%B0%D0%BD%D1%88\" title=\"\u041b\u0430-\u041c\u0430\u043d\u0448\">\u041b\u0430-\u041c\u0430\u043d\u0448<\/a>, \u043f\u043e\u0442\u0435\u0440\u043f\u0435\u043b \u043d\u0435\u0443\u0434\u0430\u0447\u0443. \u041f\u0440\u043e\u043b\u0435\u0442\u0435\u0432 10-13&#160;\u043a\u043c, \u043e\u043d \u0443\u043f\u0430\u043b \u0432 \u043c\u043e\u0440\u0435 \u0438\u0437-\u0437\u0430 \u043d\u0435\u0438\u0441\u043f\u0440\u0430\u0432\u043d\u043e\u0441\u0442\u0438 \u0434\u0432\u0438\u0433\u0430\u0442\u0435\u043b\u044f, \u043a\u043e\u0442\u043e\u0440\u0443\u044e \u043d\u0435 \u0441\u0443\u043c\u0435\u043b \u0443\u0441\u0442\u0440\u0430\u043d\u0438\u0442\u044c \u0432 \u043f\u043e\u043b\u0451\u0442\u0435. \u041b\u0430\u0442\u0430\u043c\u0430 \u043f\u043e\u0434\u043e\u0431\u0440\u0430\u043b \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0439 \u0432\u043e\u0435\u043d\u043d\u044b\u0439 \u043a\u043e\u0440\u0430\u0431\u043b\u044c \u00ab\u0413\u0430\u0440\u043f\u0443\u043d\u00bb. \u0427\u0435\u0440\u0435\u0437 6 \u0434\u043d\u0435\u0439 \u0443\u0441\u043f\u0435\u0445\u0430 \u0434\u043e\u0431\u0438\u043b\u0441\u044f \u0434\u0440\u0443\u0433\u043e\u0439 \u0444\u0440\u0430\u043d\u0446\u0443\u0437&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%83%D0%B8_%D0%91%D0%BB%D0%B5%D1%80%D0%B8%D0%BE\" class=\"mw-redirect\" title=\"\u041b\u0443\u0438 \u0411\u043b\u0435\u0440\u0438\u043e\">\u041b\u0443\u0438 \u0411\u043b\u0435\u0440\u0438\u043e<\/a>. \u041d\u0435\u0443\u0434\u0430\u0447\u043d\u0438\u043a \u043d\u0430 \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u0439 \u0433\u043e\u0434 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u043b \u0440\u0435\u043a\u043e\u0440\u0434 \u0432\u044b\u0441\u043e\u0442\u044b \u043f\u043e\u043b\u0451\u0442\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1914\" class=\"mw-redirect\" title=\"1914\">1914<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D1%81%D0%BF%D1%83%D1%82%D0%B8%D0%BD,_%D0%93%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D0%B8%D0%B9_%D0%95%D1%84%D0%B8%D0%BC%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0420\u0430\u0441\u043f\u0443\u0442\u0438\u043d, \u0413\u0440\u0438\u0433\u043e\u0440\u0438\u0439 \u0415\u0444\u0438\u043c\u043e\u0432\u0438\u0447\">\u0413\u0440\u0438\u0433\u043e\u0440\u0438\u0439 \u0420\u0430\u0441\u043f\u0443\u0442\u0438\u043d<\/a> \u0432\u044b\u0436\u0438\u043b \u043f\u043e\u0441\u043b\u0435 \u043f\u043e\u043f\u044b\u0442\u043a\u0438 \u043f\u043e\u043a\u0443\u0448\u0435\u043d\u0438\u044f \u043d\u0430 \u043d\u0435\u0433\u043e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1915\" class=\"mw-redirect\" title=\"1915\">1915<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%83%D1%82%D0%B1%D0%BE%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D0%B0%D1%81%D1%81%D0%BE%D1%86%D0%B8%D0%B0%D1%86%D0%B8%D1%8F_%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D0%B8\" title=\"\u0424\u0443\u0442\u0431\u043e\u043b\u044c\u043d\u0430\u044f \u0430\u0441\u0441\u043e\u0446\u0438\u0430\u0446\u0438\u044f \u0410\u043d\u0433\u043b\u0438\u0438\">\u0424\u0443\u0442\u0431\u043e\u043b\u044c\u043d\u0430\u044f \u0430\u0441\u0441\u043e\u0446\u0438\u0430\u0446\u0438\u044f \u0410\u043d\u0433\u043b\u0438\u0438<\/a> \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u043b\u0430, \u0447\u0442\u043e \u0432 \u0441\u0432\u044f\u0437\u0438 \u0441 \u0432\u043e\u0439\u043d\u043e\u0439 \u0432 \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0435\u043c \u0433\u043e\u0434\u0443 \u043e\u0442\u043c\u0435\u043d\u044f\u044e\u0442\u0441\u044f \u0432\u0441\u0435 \u043c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0435 \u0432\u0441\u0442\u0440\u0